            </Subw1In2>
          </Subw1In1>

        </SubWrapper1>
        <SubWrapper2>
          <Subw1In1>
            <Subw1In2>
              <Timeline>
                <TextBox
                  color={properties.littleLightGrey}
                  fontSize={fSize.slarge}
                >
                  Venue
                    </TextBox>
              </Timeline>
            </Subw1In2>
          </Subw1In1>
        </SubWrapper2>
      </MainWrapper>

      <Footer />
      <FooterDown />
    </div >
    )
  }
}

export default Home
